import React, { Component } from 'react';
import './SearchPage.css';
import {withProvider} from '../GlobalProvider.js';
import ImgList from './ImgList.js'


class SearchOptions extends Component {
    constructor() {
		super();
		this.state = {
			imgs: []
		};
	}

	componentDidMount() {
		fetch('https://api.unsplash.com/photos/?client_id=734bbebaa77968a6b81ac40081466b1648ab43246609e5ec00aff533cd24d775')
			.then(res => res.json())
			.then(data => {
				this.setState({ imgs: data });
			})
			.catch(err => {
				console.log('Error happened during fetching!', err);
			});
    }

    render() { 
        return ( 
            <div className="container">
            <div>
				<div className="main-header">
					<div className="inner">
						<h1 className="main-title">ImageSearch</h1>
					</div>
				</div>
				<div className="main-content">
					<ImgList data={this.state.imgs} />
				</div>
			</div>
            </div>
        );
    }
}

export default withProvider(SearchOptions);
